      navigate("/Login", { state: { languages: `${Doc}` } });
    }, 900);
  };

  const send_Mail = (e) => {
    e.preventDefault();
    var templateParams = {
      user_email: `${email}`,
    };
    emailjs
      .send(
        "service_u5757dr",
        "template_dueh1d9",
        templateParams,
        "Npnv-PIsN0-rxduac"
      )
      .then(
        (result) => {
          console.log(result.text);
        },
        (error) => {
          console.log(error.text);
        }
      );
    // e.target.reset();
    handleClose();
